import React from 'react';
import { View, Text, TouchableHighlight } from 'react-native-web';
import CreateSvg from '../assets/icons/createSvg';
import useStyles from './styles/greetingsScreen.module';
import SearchInput from '../components/inputs/searchInput/searchInput';

export default function MainUnauthScreen({ navigation }) {
  const styles = useStyles();
  const results = [
    {
      avatar: {uri: 'https://i.pinimg.com/originals/ff/08/f7/ff08f72a4e972b93b8651c0b48f1fdbe.jpg'},
      name: 'Rock',
      onPress: ({navigation}) => navigation.navigate('Auth'),
    },
    {
      avatar: {uri: 'https://i.pinimg.com/originals/ff/08/f7/ff08f72a4e972b93b8651c0b48f1fdbe.jpg'},
      name: 'Rock',
      onPress: ({navigation}) => navigation.navigate('Auth'),
    },
  ];

  return (
    <View style={styles.containerMain}>
      <View style={styles.messageContainer}>
      <SearchInput style={{ marginRight: 10 }} results={results}  navigation={navigation}/>
      </View>
      <View style={styles.bottomLeft}>
        <TouchableHighlight onPress={() => navigation.navigate('Auth')}>
          <CreateSvg />
        </TouchableHighlight>
      </View>
    </View>
  );
}
